import ItemAdder from "../ItemAdder/ItemAdder";
import Header from "../Header/Header";
import TodosList from '../ToDoList/ToDoList'
import '../App/App.css'
import FormControlLabel from ''

const App = ({visible}) => {
    return (
        
        <div className="app">
              <FormControlLabel
        control={<MaterialUISwitch sx={{ m: 1 }} defaultChecked />}
        label="MUI switch"
      />
            <Header />
            <ItemAdder />
            <TodosList />
        </div>

    );
};

  

export default App;
